import React, { Component } from 'react'
import { Tab, Tabs, TabList } from 'react-tabs';
import TabDoor from './tabs_nav/TabDoor';
import '../css/TabsNav'

export default class TabComponent extends Component {
    render() {
        return (
            <div>
                <Tabs>
                    <TabList>
                        <Tab><TabDoor /></Tab>
                        <Tab><TabDoor /></Tab>
                        <Tab><TabDoor /></Tab>
                    </TabList>
                </Tabs>
            </div>
        )
    }
}
